import React, {Component} from 'react'
import FeedItem from './feedItem'

class unregisteredFeed extends Component{

state = {
    unidentified: []
}

style = {
    overflow: 'scroll',
    height: '350px'
}


render(){

    setInterval(()=>{
        let newList = this.state.unidentified.map((e, i)=>{
            return <FeedItem key="i"></FeedItem>
        })
        newList.push(<FeedItem>ALECLAWLOR</FeedItem>)
        this.setState({unidentified: newList})
    }, 8000)

    return(
    <div style={this.style}>
        <h1>Unregistered Activity</h1>
        {this.state.unidentified[this.state.unidentified.length - 1]}
    </div>)}
}


export default unregisteredFeed
